import './App.css';
import Navbar from './components/Navbar';
import User from './components/User';
import Error from './components/Error';
import { Route, Routes } from 'react-router-dom'
function App() {
  return (
    <div>
      <Navbar />
      <Sideba/>
      <Routes>
        <Route path="" element={<User />} />
        <Route path='*' element={<Error />} />
      </Routes>
    </div>
  );
}

export default App;
